INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.18, 1, 11300101, 3001, 8, 7, 10, 1, 10, "vo_minigame_1012_result_1000", "フフ、全問正解よ！\nちゃんと勉強してるみたいで\n感心だわ♪", 4, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.33, 1, 11300102, 3001, 7, 8, 10, 1, 10, "vo_minigame_1012_result_1001", "すごいじゃない…全問正解よ！\nま、当然といや当然よね～\nだってあたしが\n教えてやってんだから♪", 10, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.41, 1, 11300103, 3001, 1, 8, 10, 1, 10, "vo_minigame_1012_result_1002", "全問正解！　パチパチパチ～♪\nこの難易度はもう完璧じゃない？\n次はもっと難しい問題に挑戦よ！\nあんたならできるって！", 10, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (8.11, 1, 11300104, 3001, 8, 5, 10, 1, 10, "vo_minigame_1012_result_1003", "へえ…難しい問題を選んだのに\n全問正解できてるじゃない！！\nちょっとあんたすごすぎだわ…！\nパーフェクトよパーフェクト！", 10, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (1.31, 1, 11300105, 3001, 5, 10, 10, 1, 10, "vo_minigame_1012_result_1004", "まる…まる…全部まる！\n難しい問題なのに全問正解よ…！\n驚いた…あんたいつの間に、\nこんなに勉強してたのよ！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.93, 1, 11300106, 3001, 8, 9, 10, 1, 10, "vo_minigame_1012_result_1005", "ここまで完璧に正解されちゃうと\nちょっと悔しいわね…！\nけど素直に褒めてやるわ！\nえらい、えらい、えら～い！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.99, 1, 11300107, 3001, 8, 5, 10, 1, 10, "vo_minigame_1012_result_1006", "すごい…あんたパーフェクトよ！\nこのままいけば次の試験、\n学年一位も夢じゃないかもね！\n楽しみだわ～♪", 4, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (8.37, 1, 11300108, 3001, 7, 8, 10, 1, 10, "vo_minigame_1012_result_1007", "満点よ！　フフ、もうあんたに\n教えることはなにもないわ…！\n逆にあたしがあんたに教わりたい\nくらいよ！　…ね、先生♪", 4, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.32, 1, 11300109, 3001, 5, 7, 10, 1, 10, "vo_minigame_1012_result_1008", "全・問・正・解！\n超難問揃いなのにすごいわね…！\nもしかしてだけど、\nあんたって天才！？", 8, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.77, 1, 11300110, 3001, 1, 7, 7, 1, 9, "vo_minigame_1012_result_1009", "お、かなりいい点数ね～！\nあたしも教えがいがあるわ♪\nさ、まだまだ勉強するわよ！", 4, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.97, 1, 11300111, 3001, 7, 8, 7, 1, 9, "vo_minigame_1012_result_1010", "うん、いい感じで点取れてるわ！\nこの調子で次は、\n満点を見せてほしいわね！", 4, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.47, 1, 11300112, 3001, 1, 5, 7, 1, 9, "vo_minigame_1012_result_1011", "あ～惜しい！\nもうちょっとで満点じゃない！\n次はパーフェクトいけるわ！\n頑張りましょ！", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.32, 1, 11300113, 3001, 7, 8, 7, 1, 9, "vo_minigame_1012_result_1012", "すごい、かなりできてるわよ！\n難しい問題なのにやるじゃない！\nあとは目指せ、満点ね！", 4, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (6.49, 1, 11300114, 3001, 7, 8, 7, 1, 9, "vo_minigame_1012_result_1013", "うん、かなりいい感じよ！\nあんたには赤点の心配なんて\nまーったくなさそうね♪\nでも勉強はやめさせないけど！", 10, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.56, 1, 11300115, 3001, 1, 5, 7, 1, 9, "vo_minigame_1012_result_1014", "あーあとちょっとで\n全問正解だったのに！\n難しい問題だけどあんたなら\n次は満点狙えるわ！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.67, 1, 11300116, 3001, 1, 8, 7, 1, 9, "vo_minigame_1012_result_1015", "うん、ほとんど正解よ！\nこんな難しい問題なのに、\nすごいじゃない！\nやっぱりあんた只者じゃないわ！", 10, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.85, 1, 11300117, 3001, 1, 7, 7, 1, 9, "vo_minigame_1012_result_1016", "着実に成長してるって感じね？\nあんたならこの難問でも、\nいつか満点取れちゃうかも…！", 10, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.88, 1, 11300118, 3001, 1, 5, 7, 1, 9, "vo_minigame_1012_result_1017", "うわー惜しいわね！\nもうちょっとで満点よ？\nま、あたしでも悩む難問だから、\nこの点数は胸を張っていいわ！", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.12, 1, 11300119, 3001, 1, 3, 4, 1, 6, "vo_minigame_1012_result_1018", "正解率は半分くらいか～\n悪くはないんだけど、あんたなら\nこんなもんじゃないでしょ？", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.34, 1, 11300120, 3001, 1, 9, 4, 1, 6, "vo_minigame_1012_result_1019", "んーはっきり言っちゃうと\n中途半端な点数ね…\nまあいいわ！こっからガンガン\n点数上げていくわよ！", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.15, 1, 11300121, 3001, 1, 3, 4, 1, 6, "vo_minigame_1012_result_1020", "う～ん、正直物足りない点数ね！\nあんたには期待してんだから、\nもっと頑張んなさい！", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.3, 1, 11300122, 3001, 1, 9, 4, 1, 6, "vo_minigame_1012_result_1021", "半分くらいの正解率か\n難しい問題だから仕方ないわね…\nでもあんたはもっとできる！\nだってあたしがついてんのよ！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.55, 1, 11300123, 3001, 1, 8, 4, 1, 6, "vo_minigame_1012_result_1022", "うん、そこそこできんじゃない！\n頑張って勉強して\nさらに上を目指しましょ！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.19, 1, 11300124, 3001, 7, 1, 4, 1, 6, "vo_minigame_1012_result_1023", "難問なのにこの正解率は\nよくやってる方よね！\nでもこんなところで\n満足してんじゃないわよ！？", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.43, 1, 11300125, 3001, 1, 7, 4, 1, 6, "vo_minigame_1012_result_1024", "難問なのに半分くらい正解\nできてんじゃない♪\nこの調子でもっと学力\n上げていきましょ！", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 1, 11300126, 3001, 1, 1, 4, 1, 6, "vo_minigame_1012_result_1025", "よし、平均点ってとこね！\nちゃんと勉強してるみたいで\n安心したわ～♪", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.72, 1, 11300127, 3001, 7, 8, 4, 1, 6, "vo_minigame_1012_result_1026", "難問揃いでこの正解率は\n大したもんよ！\nま、もっといい点取りたいんなら\n勉強、付き合ったげるわ！", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.5, 1, 11300128, 3001, 2, 3, 1, 1, 3, "vo_minigame_1012_result_1027", "なるほど…\nこれは教えがいがあるわね\nビシバシ鍛えてやるから\n覚悟しなさい！", 1, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.25, 1, 11300129, 3001, 2, 4, 1, 1, 3, "vo_minigame_1012_result_1028", "ちょっとあんた、\n全然できてないじゃない！\n…まさかこれが本気だなんて\n言わないわよね～？", 1, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.62, 1, 11300130, 3001, 2, 3, 1, 1, 3, "vo_minigame_1012_result_1029", "うーん……適当に答えても\nこれくらい正解できるわよ？\nちょっと本腰入れて\n教えないとね……！", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.5, 1, 11300131, 3001, 1, 9, 1, 1, 3, "vo_minigame_1012_result_1030", "…ま、まあこの問題は\nあんたには難しすぎたのかもね\nちょっとずつでいいから、\nレベルアップしていきましょ！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 1, 11300132, 3001, 3, 3, 1, 1, 3, "vo_minigame_1012_result_1031", "んー結構ミスっちゃってるわね…\nこのまま続けるのもいいけど、\n簡単な問題からやり直すのも\nありかもよ～？", 9, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 1, 11300133, 3001, 9, 9, 1, 1, 3, "vo_minigame_1012_result_1032", "あらら、あんたにはちょっと\n難しすぎたかしら…？\nもう一回やり直しましょうか！", 9, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 1, 11300134, 3001, 3, 3, 1, 1, 3, "vo_minigame_1012_result_1033", "うーん、残念な結果ね…\n超難問だから仕方ないけど\n無理せず簡単な問題から挑戦\nしてもいいかもよ？", 6, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.97, 1, 11300135, 3001, 9, 3, 1, 1, 3, "vo_minigame_1012_result_1034", "正解率はかなり悪いわね…\nまあ難しい問題だもんね…！\nそのチャレンジ精神は買うわ！", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.1, 1, 11300136, 3001, 1, 3, 1, 1, 3, "vo_minigame_1012_result_1035", "なんとか０点は免れたわね…\n難問揃いだけど、\nもっと頑張っていきましょ！", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.31, 1, 11300137, 3001, 2, 6, 0, 1, 0, "vo_minigame_1012_result_1036", "…あんたさ、０点なんて\n逆に取るの難しいわよ！？\nまさか狙ったわけじゃ\nないでしょーね～！？", 1, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.1, 1, 11300138, 3001, 2, 2, 0, 1, 0, "vo_minigame_1012_result_1037", "０点って…\nあんたふざけてんの！？\nちゃんとやらないなら\n電撃魔法くらわせるわよ！？", 1, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.23, 1, 11300139, 3001, 3, 9, 0, 1, 0, "vo_minigame_1012_result_1038", "もしかしたらあんたは\n勉強向いてないのかもね…\n…勉強だけがすべてじゃないわ\n違うとこで頑張りましょ！", 9, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.38, 1, 11300140, 3001, 2, 3, 0, 1, 0, "vo_minigame_1012_result_1039", "怒んないから正直に言って？\n…ふざけて答えたでしょ？\nほら、正直に\n言・い・な・さ・い？", 0, 2);
