INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.24, 1, 12300146, 3001, 7, 1, 5, 2, 9, "vo_minigame_1012_result_1078", "ふ～ん、まあまあの出来だわ\n悪くはないんだけど…あんたには\nもっともっと期待してるわ～", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.74, 1, 12300147, 3001, 1, 7, 5, 2, 9, "vo_minigame_1012_result_1079", "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 1, 12300148, 3001, 1, 1, 5, 2, 9, "vo_minigame_1012_result_1080", "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.21, 1, 12300149, 3001, 1, 8, 5, 2, 9, "vo_minigame_1012_result_1081", "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.46, 1, 12300150, 3001, 1, 3, 5, 2, 9, "vo_minigame_1012_result_1082", "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.94, 1, 12300151, 3001, 1, 3, 5, 2, 9, "vo_minigame_1012_result_1083", "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.19, 1, 12300152, 3001, 1, 7, 5, 2, 9, "vo_minigame_1012_result_1084", "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 1, 12300153, 3001, 1, 1, 5, 2, 9, "vo_minigame_1012_result_1085", "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.63, 1, 12300154, 3001, 1, 3, 5, 2, 9, "vo_minigame_1012_result_1086", "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.53, 1, 12300155, 3001, 1, 3, 1, 2, 4, "vo_minigame_1012_result_1087", "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 1, 12300156, 3001, 3, 3, 1, 2, 4, "vo_minigame_1012_result_1088", "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 9, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.15, 1, 12300157, 3001, 1, 3, 1, 2, 4, "vo_minigame_1012_result_1089", "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 3, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 1, 12300158, 3001, 9, 9, 1, 2, 4, "vo_minigame_1012_result_1090", "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 9, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.37, 1, 12300159, 3001, 1, 3, 1, 2, 4, "vo_minigame_1012_result_1091", "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (1.44, 1, 12300160, 3001, 1, 3, 1, 2, 4, "vo_minigame_1012_result_1092", "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 1, 12300161, 3001, 3, 3, 1, 2, 4, "vo_minigame_1012_result_1093", "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.91, 1, 12300162, 3001, 9, 3, 1, 2, 4, "vo_minigame_1012_result_1094", "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 3, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.61, 1, 12300163, 3001, 1, 5, 1, 2, 4, "vo_minigame_1012_result_1095", "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.63, 1, 12300164, 3001, 2, 4, 0, 2, 0, "vo_minigame_1012_result_1096", "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 1, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.16, 1, 12300165, 3001, 2, 6, 0, 2, 0, "vo_minigame_1012_result_1097", "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 1, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 1, 12300166, 3001, 3, 3, 0, 2, 0, "vo_minigame_1012_result_1098", "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 6, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.75, 1, 12300167, 3001, 2, 6, 0, 2, 0, "vo_minigame_1012_result_1099", "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.64, 1, 12300168, 3001, 2, 4, 0, 2, 0, "vo_minigame_1012_result_1100", "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 1, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.73, 1, 12300169, 3001, 4, 8, 0, 2, 0, "vo_minigame_1012_result_1101", "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 8, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.32, 1, 12300170, 3001, 3, 5, 0, 2, 0, "vo_minigame_1012_result_1102", "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 1, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.37, 1, 12300171, 3001, 9, 3, 0, 2, 0, "vo_minigame_1012_result_1103", "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 9, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.25, 1, 12300172, 3001, 1, 9, 0, 2, 0, "vo_minigame_1012_result_1104", "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！", 3, 3);
