INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 2, 22300156, 3001, 4, 4, 1, 2, 4, "vo_minigame_1012_result_2088", "うーん…さっぱり！\nでも簡単な問題なんだよね…？\nもっかいやってみる？", 6, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.28, 2, 22300157, 3001, 3, 0, 1, 2, 4, "vo_minigame_1012_result_2089", "うちらまだまだ\nベンキョーちうだし…\nこれからだよねっ？\nね、ヒデサイ！", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.89, 2, 22300158, 3001, 3, 0, 1, 2, 4, "vo_minigame_1012_result_2090", "ちょっとずつ覚えれば\nおーけーっしょ！\nうちと一緒に\nベンキョーだね！", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (5.45, 2, 22300159, 3001, 7, 0, 1, 2, 4, "vo_minigame_1012_result_2091", "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？", 0, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.29, 2, 22300160, 3001, 10, 4, 1, 2, 4, "vo_minigame_1012_result_2092", "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (4.64, 2, 22300161, 3001, 8, 4, 1, 2, 4, "vo_minigame_1012_result_2093", "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 6, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.14, 2, 22300162, 3001, 5, 9, 1, 2, 4, "vo_minigame_1012_result_2094", "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (6.59, 2, 22300163, 3001, 4, 7, 1, 2, 4, "vo_minigame_1012_result_2095", "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 0, 3);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.0, 2, 22300164, 3001, 3, 3, 0, 2, 0, "vo_minigame_1012_result_2096", "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 0, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.2, 2, 22300165, 3001, 10, 9, 0, 2, 0, "vo_minigame_1012_result_2097", "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？", 5, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (0.01, 2, 22300166, 3001, 4, 4, 0, 2, 0, "vo_minigame_1012_result_2098", "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？", 6, 1);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.8, 2, 22300167, 3001, 2, 6, 0, 2, 0, "vo_minigame_1012_result_2099", "え、ヒデサイも０点？\nじゃあうちと一緒じゃん♪\nまあ焦んないで\nベンキョーしてこーよ！", 3, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (3.22, 2, 22300168, 3001, 4, 9, 0, 2, 0, "vo_minigame_1012_result_2100", "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変", 6, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.1, 2, 22300169, 3001, 0, 4, 0, 2, 0, "vo_minigame_1012_result_2101", "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！", 11, 2);
INSERT INTO `v1_20c1741f1e4ec066c54cefa57c2260b930b77131a2ce5fdfa801c4d6fd625f1a` VALUES (2.74, 2, 22300170, 3001, 2, 0, 0, 2, 0, "vo_minigame_1012_result_2102", "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！", 3, 3);
